import React from "react";
import { Container, Row, Col } from 'reactstrap';


function UploadForm() {
    return <>
        <Container>
            <Row>
                <Col>
                    <h1>hello</h1>
                </Col>
            </Row>
        </Container>
    
    </>
}

export default UploadForm;
